import React from "react";

const SuperchargedSection = () => {
  return (
    <div className="relative bg-black text-white py-16 px-8 flex flex-col items-center text-center">
      {/* Background Image */}
      <div className="absolute inset-0 rounded-lg overflow-hidden">
        <img
          src="https://framerusercontent.com/images/vP0en219LMqVhHyWMZMxYWk8Dw.svg"
          alt="Background decoration"
          className="w-full h-full object-cover"
        />
      </div>

      {/* Content */}
      <div className="relative z-10 max-w-3xl space-y-6">
        {/* Title */}
        <p className="text-pink-300 font-medium text-lg">Supercharged</p>
        {/* Headline */}
        <div>
          <p className="text-4xl font-semibold leading-tight">
            Up to 3X higher
          </p>
          <p className="text-4xl font-semibold leading-tight">
            engagement and conversions
          </p>
        </div>
        {/* Description */}
        <p className="text-gray-400 text-lg leading-relaxed">
          A whole new way to generate media for your stores. Create images,
          videos, text, ads, and 3D that lets your customers see your brand in
          ways never before.
        </p>
      </div>
    </div>
  );
};

export default SuperchargedSection;
